import React from "react";
import { Link } from "react-router-dom";
import "./tailwind.css";

import bird from "./images/daily/Top.webp";

export const Top = () => {
  return (
    <>
      <div class="flex">
        <div class="flex">
          <Link class="p-4 bg-blue-300 rounded-lg text-white" to="/daily">
            日報を見る
          </Link>
          <div class="float-right">
            <img src={bird} alt="imgaes" />
          </div>
        </div>
      </div>
    </>
  );
};
